script: |
  super -f text -I q9685.spq | sort > q9685.out

inputs:
  - name: q9685.spq
    data: |
      SELECT - ( 5 ) * + cor0.col1 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab2

outputs:
  - name: q9685.out
    data: |
      -430
      -430
      -430
      -455
      -455
      -455
      -485
      -485
      -485
